"      Cepacol&reg;;",
"     </li>",
"     <li>",
"      Kank-A&reg;",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"ex_sect_xr thclist drugH1Div drugBrandNames\" id=\"F149104\" xmlns=\"file://www.w3.org/1999/xhtml\">",
