"      Local Anesthetic",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block doa drugH1Div\" id=\"F149100\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Adult",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Antiseptic/anesthetic: Oral: Dissolve in mouth as needed for sore throat",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Antiseptic/anesthetic (dental use): Oral: Dissolve in mouth as needed for pain",
"    </p>",
"   </div>",
"   <div class=\"block doe drugH1Div\" id=\"F149101\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Geriatric",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Refer to adult dosing.",
"    </p>",
"   </div>",
"   <div class=\"block foc drugH1Div\" id=\"F4423365\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Forms: U.S.",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Excipient information presented when available (limited, particularly for generics); consult specific product labeling.",
"    </p>",
"   </div>",
"   <div class=\"block prod-avail drugH1Div\" id=\"F11217374\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Product Availability",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Not available in U.S.",
"    </p>",
"   </div>",
