"    <span class=\"drugH1\">",
"     Use",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Symptomatic relief of sore throat",
"    </p>",
"   </div>",
"   <div class=\"block cyt drugH1Div\" id=\"F13299008\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Metabolism/Transport Effects",
