var title_f25_18_25901="Clues RD 2nd grade and up";
var content_f25_18_25901=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F54976&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F54976&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Clues to dyslexia from second grade on",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Problems in speaking",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Mispronunciation of long, unfamiliar, or complicated words; the",
"       <em>",
"        fracturing",
"       </em>",
"       of words--leaving out parts of words or confusing the order of the parts of words; for example",
"       <em>",
"        aluminum",
"       </em>",
"       becomes",
"       <em>",
"        amulium",
"       </em>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Speech that is not fluent--pausing or hesitating often when speaking, lots of",
"       <em>",
"        um's",
"       </em>",
"       during speech, no glibness",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       The use of imprecise language, such as vague references to",
"       <em>",
"        stuff",
"       </em>",
"       or",
"       <em>",
"        things",
"       </em>",
"       instead of the proper name of an object",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Not being able to find the exact word, such as confusing words that sound alike: saying",
"       <em>",
"        tornado",
"       </em>",
"       instead of",
"       <em>",
"        volcano,",
"       </em>",
"       substituting",
"       <em>",
"        lotion",
"       </em>",
"       for",
"       <em>",
"        ocean,",
"       </em>",
"       or",
"       <em>",
"        humanity",
"       </em>",
"       for",
"       <em>",
"        humidity",
"       </em>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       The need for time to summon an oral response or the inability to come up with a verbal response quickly when questioned",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Difficulty in remembering isolated pieces of verbal information (rote memory)--trouble remembering dates, names, telephone numbers, random lists",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Problems in reading",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Very slow progress in acquiring reading skills",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       The lack of a strategy to read new words",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Trouble reading",
"       <em>",
"        unknown",
"       </em>",
"       (new, unfamiliar) words that must be sounded out; making wild stabs or guesses at reading a word; failure to systematically sound out words",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       The inability to read small \"function\" words, such as",
"       <em>",
"        that,",
"       </em>",
"       <em>",
"        an,",
"       </em>",
"       <em>",
"        in",
"       </em>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Stumbling on reading multisyllable words, or the failure to come close to sounding out the full word",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Omitting parts of words when reading; the failure to decode parts within a word, as if someone had chewed a hole in the middle of the word, such as",
"       <em>",
"        conible",
"       </em>",
"       for",
"       <em>",
"        convertible",
"       </em>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       A terrific fear of reading out loud; the avoidance of oral reading",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Oral reading filled with substitutions, omissions, and mispronunciations",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Oral reading that is choppy and labored, not smooth or fluent",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Oral reading that lacks inflection and sounds like the reading of a foreign language",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       A reliance on context to discern the meaning of what is read",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       A better ability to understand words",
"       <em>",
"        in context",
"       </em>",
"       than to read",
"       <em>",
"        isolated",
"       </em>",
"       single words",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Disproportionately poor performance on multiple-choice tests",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       The inability to finish tests on time",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       The substitution of words with the same meaning for words in the text he can't pronounce, such as",
"       <em>",
"        car",
"       </em>",
"       for",
"       <em>",
"        automobile",
"       </em>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Disastrous spelling, with words not resembling true spelling; some spellings may be missed by spell check",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Trouble reading mathematics word problems",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Reading that is very slow and tiring",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Homework that never seems to end, or with parents often recruited as readers",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Messy handwriting despite what may be an excellent facility at word processing--nimble fingers",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Extreme difficulty learning a foreign language",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       A lack of enjoyment of reading, and the avoidance of reading books or even a sentence",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       The avoidance of reading for pleasure, which seems too exhausting",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Reading whose accuracy improves over time, though it continues to lack fluency and is laborious",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Lowered self-esteem, with pain that is not always visible to others",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       A history of reading, spelling, and foreign language problems in family members",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Shaywitz S. Overcoming Dyslexia: A New and Complete Science-Based Program for Reading Problems at Any Level. Copyright &copy; 2003 by Sally Shaywitz, M.D. Used with permission of Alfred A. Knopf, a division of Random House, Inc. For on-line information about other Random House, Inc. books and authors, see the Internet Web site at www.randomhouse.com.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
